import React, { useState, useEffect } from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Box, Container, Card, Grid, CardContent, Typography, Button, TextField } from "@mui/material";
import { getProfessionals } from '../../redux/slices/appointments/thunks';

const Professionals = () => {
    const { professionals: professionalData } = useSelector((state) => state.professionals);
    const [editingProfessional, setEditingProfessional] = useState(null);
    const dispatch = useDispatch();
    const [clientDataToUpdate, setClientDataToUpdate] = useState({
        name: "",
        dateOfBirth: "",
        phone: "",
        mail: ""
    });

    useEffect(() => {
        dispatch(getProfessionals());
    }, [dispatch]);

    const handleEdit = (professional) => {
        setEditingProfessional(professional);
    };

    const handleFieldChange = (e) => {
        const { name, value } = e.target;
        setClientDataToUpdate(prevState => ({
            ...prevState,
            [name]: value
        }));
    };

    const handleSave = (clientDataToUpdate, dni) => {
        const clientData = Object.keys(clientDataToUpdate).reduce((acc, key) => {
            if (clientDataToUpdate[key] !== "") {
                acc[key] = clientDataToUpdate[key];
            }
            return acc;
        }, {});

        if (Object.keys(clientData).length > 0) {
            // Lógica para guardar los cambios
        }

        setEditingProfessional(null);
    };

    const handleCancel = () => {
        setEditingProfessional(null);
    };

    return (
        <Container maxWidth="xl" style={{ height: '100vh', overflow: 'hidden' }}>
            <Box sx={{ maxHeight: '100%', overflowY: 'auto', height: '100%', width: '100%' }}>
                {professionalData.length > 0 ? (
                    <Grid container spacing={2}>
                        {professionalData.map((professional, index) => (
                            <Grid item xs={12} key={index}>
                                <Card variant="outlined" sx={{
                                    transition: 'transform 0.5s ease',
                                    '&:hover': {
                                        transform: 'scale(1.05)'
                                    },
                                    transform: editingProfessional === professional ? 'scale(1)' : 'scale(1)'
                                }}>
                                    <CardContent sx={{
                                        display: 'flex',
                                        flexDirection: 'row',
                                        gap: '20px',
                                        justifyContent: 'center',
                                        alignItems: 'center'
                                    }}>
                                        {editingProfessional === professional ? (
                                            <>
                                                <TextField
                                                    label="Nombre"
                                                    defaultValue={professional.name}
                                                    name="name"
                                                    onChange={handleFieldChange}
                                                />
                                                <TextField
                                                    label="DNI"
                                                    defaultValue={professional.dni}
                                                    disabled
                                                />
                                                <TextField
                                                    label="Fecha de Nacimiento"
                                                    defaultValue={professional.dateOfBirth}
                                                    name="dateOfBirth"
                                                    onChange={handleFieldChange}
                                                />
                                                <TextField
                                                    label="Teléfono"
                                                    defaultValue={professional.phone}
                                                    name="phone"
                                                    onChange={handleFieldChange}
                                                />
                                                <TextField
                                                    label="Correo electrónico"
                                                    defaultValue={professional.mail}
                                                    name="mail"
                                                    onChange={handleFieldChange}
                                                />
                                                <Button
                                                    variant="contained"
                                                    onClick={() => handleSave(clientDataToUpdate, professional.dni)}
                                                    sx={{
                                                        backgroundColor: '#b4cbb7',
                                                        color: '#ffffff',
                                                        padding: '10px 20px',
                                                        '&:hover': {
                                                            backgroundColor: '#5a5a5b',
                                                        },
                                                    }}
                                                >
                                                    Guardar
                                                </Button>
                                                <Button
                                                    variant="contained"
                                                    onClick={handleCancel}
                                                    sx={{
                                                        backgroundColor: '#b4cbb7',
                                                        color: '#ffffff',
                                                        padding: '10px 20px',
                                                        '&:hover': {
                                                            backgroundColor: '#5a5a5b',
                                                        },
                                                    }}
                                                >
                                                    Cancelar
                                                </Button>
                                            </>
                                        ) : (
                                            <>
                                                <Typography variant="h5" component="div" sx={{ fontSize: '1rem' }}>
                                                    {professional.name}
                                                </Typography>
                                                <Typography color="text.secondary" component='div' sx={{ fontSize: '1rem' }}>
                                                    DNI: {professional.dni}
                                                </Typography>
                                                {/* Agrega más detalles del profesional aquí según tu estructura de datos */}
                                                <Button onClick={() => handleEdit(professional)}>Editar</Button>
                                            </>
                                        )}
                                    </CardContent>
                                </Card>
                            </Grid>
                        ))}
                    </Grid>
                ) : (
                    <p>El array está vacío</p>
                )}
            </Box>
        </Container>
    );
};

export default Professionals;
